import React, { useEffect } from "react";
import { SNPContainer1, SNPContainer2 } from "./pageStyles";
import NotePadEditor from "../components/NotePad/NotePadEditor";

const NotesPage = () => {
  useEffect(() => {}, []);

  const save = () => {
    alert("Save");
  };

  return (
    <Fragment>
      <SNPContainer2>
        <NotePadEditor />
      </SNPContainer2>
      <SNPContainer1>
        <button onClick={save()}>Save</button>;
      </SNPContainer1>
    </Fragment>
  );
};

export default NotesPage;
